import React from 'react';
import Header from '../../components/Header';
import ProductCard from '../../components/ProductCard';


export default function Results(){
    return(
        <Page>
        <Header />
        {products.map((product) => {
          return (
            <ProductCard
              image={product.image}
              title={product.title}
              description={product.description}
              price={product.price}
            />
          );
        })}
      </Page>
    );

};
